/* Library1n image */
.Library1 {
 width:1340px;
   height: 534px;
   margin-left: 5px;
  }
  .motto {
     width: 653px; 
    color: #070C70; 
    font-size: 96px; 
  font-family: Poppins; 
  font-weight: 500;
   letter-spacing: 1.92px; 
   word-wrap: break-word;
   animation: text-shadow 1.5s ease-in-out ;
  } 
.motto:hover {
    animation:  text-shadow 1.5s ease-in-out  infinite;
}
@keyframes text-shadow {
    0% {  
        transform: translateY(0);
        text-shadow: 
            0 0 0 #0c2ffb, 
            0 0 0 #2cfcfd, 
            0 0 0 #fb203b, 
            0 0 0 #fefc4b;
    }

    20% {  
        transform: translateY(-1em);
        text-shadow: 
            0 0.125em 0 #0c2ffb, 
            0 0.25em 0 #2cfcfd, 
            0 -0.125em 0 #fb203b, 
            0 -0.25em 0 #fefc4b;
    }

    40% {  
        transform: translateY(0.5em);
        text-shadow: 
            0 -0.0625em 0 #0c2ffb, 
            0 -0.125em 0 #2cfcfd, 
            0 0.0625em 0 #fb203b, 
            0 0.125em 0 #fefc4b;
    }
    
   60% {
        transform: translateY(-0.25em);
        text-shadow: 
            0 0.03125em 0 #0c2ffb, 
            0 0.0625em 0 #2cfcfd, 
            0 -0.03125em 0 #fb203b, 
            0 -0.0625em 0 #fefc4b;
    }

    80% {  
        transform: translateY(0);
        text-shadow: 
            0 0 0 #0c2ffb, 
            0 0 0 #2cfcfd, 
            0 0 0 #fb203b, 
            0 0 0 #fefc4b;
    }
}
  .mottoDiv{
    mix-blend-mode: darken;
    display: flex;
    position: absolute;
    isolation: isolate;
    flex-direction: row;
    justify-content: flex-start;
    align-items: flex-start;
    padding: 0px;
    box-sizing: border-box;
    width: 678px;
    height: 85px;
 bottom: 500px;
 left: 50px; 
    }
  /* Group48 */
  .Group48 {
    mix-blend-mode: darken;
    display: flex;
    position: absolute;
    isolation: isolate;
    flex-direction: row;
